import React from "react";

const Axios = () => {
  return (
    <>
      <select>
        <option value='1'>1</option>
        <option value='3'>3</option>
        <option value='25'>25</option>
        <option value='2'>2</option>
      </select>
    </>
  );
};

export default Axios;
